import React from "react";

const options = [
  "sukiicat",
  "albertbabycat",
  "smoothiethecat",
  "realgrumpycat"
];

export const Search = ({ search, onSearch }) => {
  return (
    <>
      {options.map(option => (
        <label key={option}>
          <input
            type="radio"
            value={option}
            checked={option === search}
            onChange={event => onSearch(event.target.value)}
          />
          {option}
        </label>
      ))}
    </>
  );
};
